aatrox = Champion.create(name: "Aatrox", image_url: "https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt570145160dd39dca/5db05fa8347d1c6baa57be25/RiotX_ChampionList_aatrox.jpg?quality=90&width=250", passive_title: "DEATHBRINGER STANCE", passive_description: "Periodically, Aatrox's next basic attack deals bonus physical damage and heals him, based on the target's max health.", q_title: "THE DARKIN BLADE", q_description: "Aatrox slams his greatsword down, dealing physical damage. He can swing three times, each with a different area of effect.", w_title: "INFERNAL CHAINS", w_description: "Aatrox smashes the ground, dealing damage to the first enemy hit. Champions and large monsters have to leave the impact area quickly or they will be dragged to the center and take the damage again.", e_title: "UMBRAL DASH", e_description: "Passively, Aatrox heals when damaging enemy champions. On activation, he dashes in a direction.", r_title: "WORLD ENDER", r_description: "Aatrox unleashes his demonic form, fearing nearby enemy minions and gaining attack damage, increased healing, and movement speed. If he gets a takedown, this effect is extended.")
ahri = Champion.create(name: "Ahri", image_url: "https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt1259276b6d1efa78/5db05fa86e8b0c6d038c5ca2/RiotX_ChampionList_ahri.jpg?quality=90&width=250", passive_title: "ESSENCE THEFT", passive_description: "When Ahri strikes 9 enemies with her abilities, her next ability also heals her for each enemy hit.", q_title: "ORB OF DECEPTION", q_description: "Ahri sends out and pulls back her orb, dealing magic damage on the way out and true damage on the way back.", w_title: "FOX-FIRE", w_description: "Ahri gains a brief burst of movement speed and releases three fox-fires, that lock onto and attack nearby enemies.", e_title: "CHARM", e_description: "Ahri blows a kiss that damages and charms an enemy it encounters, instantly stopping movement abilities and causing them to walk harmlessly towards her. The target temporarily takes increased damage from Ahri.", r_title: "SPIRIT RUSH", r_description: "Ahri dashes forward and fires essence bolts, damaging nearby enemies. Spirit Rush can be cast up to three times before going on cooldown.")
akali = Champion.create(name: "Akali", image_url: "https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt80ff58fe809777ff/5db05fa8adc8656c7d24e7d6/RiotX_ChampionList_akali.jpg?quality=90&width=250", passive_title: "ASSASSIN'S MARK", passive_description: "Dealing spell damage to a champion creates a ring of energy around them. Exiting that ring empowers Akali's next autoattack with bonus range and damage.", q_title: "FIVE POINT STRIKE", q_description: "Akali throws out five kunai, dealing damage based on her bonus Attack Damage and Ability Power and slowing.", w_title: "TWILIGHT SHROUD", w_description: "Akali drops a cover of smoke and briefly gains Movement Speed. While inside the shroud, Akali becomes invisible and unable to be selected by enemy spells and attacks. Attacking or using abilities will briefly reveal her.", e_title: "SHURIKEN FLIP", e_description: "Flip backward and fire a shuriken forward, dealing magic damage. The first enemy or smoke cloud hit is marked. Re-cast to dash to the marked target, dealing additional damage.", r_title: "PERFECT EXECUTION", r_description: "Akali leaps in a direction, damaging enemies she strikes. Re-cast: Akali dashes in a direction, executing all enemies she strikes.")
alistar = Champion.create(name: "Alistar", image_url: "https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt3b366925d2fd8fdb/5db05fa856458c6b3fc1750b/RiotX_ChampionList_alistar.jpg?quality=90&width=250", passive_title: "TRIUMPHANT ROAR", passive_description: "Alistar charges his roar by stunning or displacing enemy champions or when nearby enemies die. When fully charged he heals himself all nearby allied champions.", q_title: "PULVERIZE", q_description: "Alistar smashes the ground, dealing damage to nearby enemies and tossing them into the air.", w_title: "HEADBUTT", w_description: "Alistar rams a target with his head, dealing damage and knocking the target back.", e_title: "TRAMPLE", e_description: "Alistar tramples nearby enemy units, ignoring unit collision and gaining stacks if he damages an enemy champion. At full stacks Alistar's next basic attack against an enemy champion deals additional magic damage and stuns them.", r_title: "UNBREAKABLE WILL", r_description: "Alistar lets out a wild roar, removing all crowd control effects on himself, and reducing incoming physical and magical damage for the duration.")
amumu = Champion.create(name: "Amumu", image_url: "https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt40dfbe48a61c439f/5db05fa80b39e86c2f83dbf9/RiotX_ChampionList_amumu.jpg?quality=90&width=250", passive_title: "CURSED TOUCH", passive_description: "Amumu's basic attacks Curse his enemies, causing them to take bonus true damage from incoming magic damage.", q_title: "BANDAGE TOSS", q_description: "Amumu tosses a sticky bandage at a target, stunning and damaging the target while he pulls himself to them.", w_title: "DISPAIR", w_description: "Overcome by anguish, nearby enemies lose a percentage of their maximum Health each second and have their Curses refreshed.", e_title: "TANTRUM", e_description: "Permanently reduces the physical damage Amumu would take. Amumu can unleash his rage, dealing damage to surrounding enemies. Each time Amumu is hit, the cooldown on Tantrum is reduced by 0.5 seconds.", r_title: "CURSE OF THE SAD MUMMY", r_description: "Amumu entangles surrounding enemy units in bandages, applying his Curse, damaging and stunning them.")
anivia = Champion.create(name: "Anivia", image_url: "https://images.contentstack.io/v3/assets/blt731acb42bb3d1659/blt3d24a1482453088a/5db05fa8df78486c826dcce8/RiotX_ChampionList_anivia.jpg?quality=90&width=250", passive_title: "REBIRTH", passive_description: "Upon taking fatal damage, Anivia reverts to an egg and is reborn with full health.", q_title: "FLASH FROST", q_description: "Anivia brings her wings together and summons a sphere of ice that flies towards her opponents, chilling and damaging anyone in its path. When the sphere explodes it does moderate damage in a radius, stunning anyone in the area.", w_title: "CRYSTALLIZE", w_description: "Anivia condenses the moisture in the air into an impassable wall of ice to block all movement. The wall only lasts a short duration before it melts.", e_title: "FROSTBITE", e_description: "With a flap of her wings, Anivia blasts a freezing gust of wind at her target, dealing damage. If the target was recently hit by Flash Frost or damaged by a fully formed Glacial Storm, the damage they take is doubled.", r_title: "GLACIAL STORM", r_description: "Anivia summons a driving rain of ice and hail to damage her enemies and slow their advance.")
